import React from 'react';
import './card.css';

const Card=(props)=>
(
    <div className='cardstyle'>
        <img alt='monster' src={`https://robohash.org/${props.monster.id}?set=set2&size=130x180`}/>

        <h2>
            {props.monster.title}
        </h2>
        <b>{props.monster.email}</b>
            
        
    </div>
)
export default Card;
